import './App.css';
import Header from './Header';
import Modal from "./Component/Modal";

function App() {
  state = {
    show: false
  };
  showModal = e => {
    this.setState({
      show: true
    });
  };

  return (
    <div className="App">
      <Header />
      <nav>
        <a onClick={e => { this.showModal(); }}>
          + Create a Character
        </a>
      </nav>
      <Modal />
    </div>
  );
}

export default App;
